export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:10}}},dnkrJ1f133:{data:{id:1581,attributes:{imdbId:"tt0084117",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODFkYzgxYzEtMGI2MC00ZThmLTgxNGQtM2IzNWFmZWQ4NTM2XkEyXkFqcGdeQXVyMzU0NzkwMDg@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"6.9\u002F10"}],item_lang:{data:{id:2244,attributes:{title:"If You Could See What I Hear",plot:"Tom Sullivan is in many ways a typical student attending a Boston area college, he, showing his immaturity, partaking in, often leading, mainly harmless student hijinks with his pipe smoking friend, Will Sly. He funnels many of his energies into his music as a singer\u002Fpianist. Tom also happens to be blind, which he's been since a newborn due to being provided too much oxygen while in an incubator. Tom is independently minded, and wants to be treated just like any sighted person. Like most men his age, he is also in the pursuit of the opposite sex, in the process of which he finds that he falls in love easily. Through all these activities, Tom is affected by real life including the temporariness of college life, some not being able to get over their own prejudices of being sighted in their dealings with him, and coming to the realization that there are some things more difficult to do in life when one is blind.",slug:"if-you-could-see-what-i-hear"}}},books:{data:[{id:8268,attributes:{title:g,description:"Tom Sullivan was born blind but grew up unwilling to be constrained by his lack of sight, taking on wrestling, baseball, piano, writing and girlfriends with vigorous enthusiasm.",thumbnail:b,authors:[d],firstBook:true,published:"2004-01-01",publisher:b,subtitle:b}},{id:8269,attributes:{title:"Together",description:"Sometimes you can't see what matters most until it's gone. Brenden McCarthy feels like he's lost everything. His fiancee. His independence. And his passion for life. All due to one tragic misstep while mountain climbing that cost him his sight. But he's about to gain the last thing he ever expected. A big-hearted black Labrador named Nelson who's given one last shot at being a Seeing Eye dog. Both are beyond hope and resigned to live alone. And both are about to experience a bond of friendship that develops when they least expect it. Together is a heartwarming story for anyone who's ever lost sight of what matters most in life . . . but has hope that there's more.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yO7MdILRsdgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d,h],firstBook:e,published:i,publisher:j,subtitle:"A Story of Shared Vision"}},{id:8270,attributes:{title:"Alive Day",description:"Based in part on a true story, Alive Day is an inspiring, affirming tale about the power of love, loyalty, and living full-out. A Marine's \"Alive Day\" celebrates the survival after an almost certain death. It's a time of hope and joy. But Antwone Carver isn't celebrating. Home from war but not quite whole, Antwone's having trouble dealing with his new physical limitations. Psychiatrist Brenden McCarthy can relate. He thought he'd lost everything when he was blinded in a mountain climbing accident. But with God's help, he's now living a satisfying life and feels called to help Antwone do the same. Problem is, he's hit one dead end after another trying to reach this bitter young Marine. Enter Brenden's big-hearted and courageous black Labrador, Nelson. With boundless energy, contagious optimism, and a big heart, Nelson shows them both what it means to live a truly abundant life. The journey Brenden began in the heartwarming novel Together continues with Alive Day.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Uol_d5zWZPEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d,h],firstBook:e,published:i,publisher:j,subtitle:"A Story of Love and Loyalty"}},{id:8271,attributes:{title:"As I See It",description:"An inspirational memoir of a man's rich life experiences without sight, but with an enormous sense of wonder. Sullivan has gleaned a number of gifts from his \"affliction,\" including cultivating a sense of his own purpose, treasuring people without expectation, and celebrating his own uniqueness.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WSSevrgZlD0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[d],firstBook:e,published:"2012-09-04",publisher:"Simon and Schuster",subtitle:"My View from the Inside Out"}},{id:8272,attributes:{title:g,description:"An inspiring autobiography of a young blind man.",thumbnail:b,authors:["Thomas J. Sullivan","Derek L. T. Gill"],firstBook:e,published:"1975-01-01",publisher:"Scarborough, Ont. : New American Library of Canada",subtitle:b}}]}}},meta:{}}},prerenderedAt:1694069552398}}("movie","","series","Tom Sullivan",null,1,"If You Could See what I Hear","Betty White","2009-07-13","Thomas Nelson"))